<p>I have it installed and setup my <code>bootstrap.php</code> like the docs say on the setup step <a href="https://www.doctrine-project.org/projects/doctrine-mongodb-odm/en/2.2/reference/introduction.html#setup" rel="nofollow noreferrer">https://www.doctrine-project.org/projects/doctrine-mongodb-odm/en/2.2/reference/introduction.html#setup</a></p>
<p>The settings file in my slim framework looks like this</p>
<pre><code>&lt;?php
declare(strict_types=1);

use DI\ContainerBuilder;
use Monolog\Logger;

return function (ContainerBuilder $containerBuilder) {
    $rootPath = realpath(__DIR__ . '/..');

    // Global Settings Object
    $containerBuilder-&gt;addDefinitions([
        'settings' =&gt; [
            // Base path
            'base_path' =&gt; '',

            // Is debug mode
            'debug' =&gt; (getenv('APPLICATION_ENV') != 'production'),

            // 'Temprorary directory
            'temporary_path' =&gt; $rootPath . '/var/tmp',

            // Route cache
            'route_cache' =&gt;$rootPath . '/var/cache/routes',

            // View settings
            'view' =&gt; [
                'template_path' =&gt;$rootPath . '/tmpl',
                'twig' =&gt; [
                    'cache' =&gt;$rootPath . '/var/cache/twig',
                    'debug' =&gt; (getenv('APPLICATION_ENV') != 'production'),
                    'auto_reload' =&gt; true,
                ],
            ],

            // doctrine settings
            'doctrine' =&gt; [
                'meta' =&gt; [
                    'entity_path' =&gt; [ $rootPath . '/src/Entity' ],
                    'auto_generate_proxies' =&gt; true,
                    'proxy_dir' =&gt; $rootPath . '/var/cache/proxies',
                    'cache' =&gt; null,
                ],
                'connection' =&gt; [
                    'driver' =&gt; 'pdo_sqlite',
                    'path' =&gt; $rootPath . '/var/blog.sqlite'
                ]
            ],

            // monolog settings
            'logger' =&gt; [
                'name' =&gt; 'app',
                'path' =&gt;  getenv('docker') ? 'php://stdout' : $rootPath . '/var/log/app.log',
                'level' =&gt; (getenv('APPLICATION_ENV') != 'production') ? Logger::DEBUG : Logger::INFO,
            ]
        ],
    ]);

    if (getenv('APPLICATION_ENV') == 'production') { // Should be set to true in production
        $containerBuilder-&gt;enableCompilation($rootPath . '/var/cache');
    }
};
</code></pre>
<p>How can i connect to my mongodb server and use it in my controllers?</p>

