The second query gets a list of different rooms where user is in and each room has sharing property set to true.</p>
<pre><code>const roomsInfo = await Promise.all([
  db.collection('rooms').find({'users.userId': user.userId}).toArray()
  db.collection('rooms').distinct('users.id', {'users.id': &quot;myuserId&quot;, share: true}),
])
